window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [game1,game2,game3,game4,game5]
        // scene:[game5]
    };
    game = new Phaser.Game(gameConfig);
}

class game1 extends Phaser.Scene {

    constructor() {
        super("game1");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = []

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        // var downloadBtn = this.physics.add.sprite(game.config.width / 2, game.config.height / 2, 'btn_download')
        //     .setInteractive();

        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);

        this.bg1 = this.add.image(512,0,'bg1').setOrigin(1,0)




        this.showPreson()

        this.resize();
        window.addEventListener("resize", this.resize, false);
    }
    showPreson(){
        var walk2 = this.add.image(200,540,'walk2')
        var walk3 = this.add.image(220,540,'walk3')
        var fall1 = this.add.image(220,540,'fall1')
        fall1.visible = 0
        var fall2 = this.add.image(220,540,'fall2')
        fall2.visible = 0

        var pan = this.add.image(30,600,'pan')
        pan.visible = 0 



        walk3.visible = 0
        this.tweens.add({
            targets:[this.bg1],
            delay:500 ,
            x:660,
            duration:2000
        })

        setTimeout(() => {
            walk2.visible = 0
            walk3.visible = 1
        }, 500);
        setTimeout(() => {
            walk2.visible = 1
            walk3.visible = 0
        }, 1000);
        var walkInt = setInterval(() => {
            setTimeout(() => {
                walk2.visible = 0
                walk3.visible = 1
            }, 500);
            setTimeout(() => {
                walk2.visible = 1
                walk3.visible = 0
            }, 1000);
        }, 1000);

        setTimeout(() => {
            walk2.alpha = 0
            walk3.alpha = 0
            clearInterval(walkInt)
            walk2.visible = 0
            walk3.visible = 0
            fall1.visible = 1
            setTimeout(() => {
                fall1.visible = 0
                fall2.visible = 1
                pan.visible = 1
                this.tweens.add({
                    targets:[fall2],
                    x:800,
                    duration:600
                })
                this.tweens.add({
                    targets:[pan],
                    x:-300,
                    y:1000,
                    duration:500,
                    onComplete:()=>{
                       
                    }
                })
                this.tweens.add({
                    targets:[this.bg1],
                    x:1024,
                    duration:500,
                    onComplete:()=>{
                        this.showWord()
                        setTimeout(() => {
                            this.scene.start('game2')
                        }, 1600);
                    }
                })
            }, 300);
        }, 2000);

    }
    showWord(){
        this.bg1 = this.add.image(0,0,'bg1').setOrigin(0,0)

        var w2_p = this.add.image(130,450,'w2_p')
        w2_p.scaleX = 0.4
        w2_p.scaleY = 0.4

        var s2_p = this.add.image(160,500,'s2_p')
        s2_p.scaleX = 0.3
        s2_p.scaleY = 0.3

        var a2_p = this.add.image(220,440,'a2_p')
        a2_p.scaleX = 0.3
        a2_p.scaleY = 0.3

        var h2_p = this.add.image(250,490,'h2_p')

        h2_p.scaleX = 0.3
        h2_p.scaleY = 0.3

        var c1_p = this.add.image(135,630,'c1_p')
        c1_p.scaleX = 0.4
        c1_p.scaleY = 0.4
        var l1_p = this.add.image(210,635,'l1_p')
        l1_p.scaleX = 0.4
        l1_p.scaleY = 0.4
        var e1_p = this.add.image(250,695,'e1_p')
        e1_p.scaleX = 0.4
        e1_p.scaleY = 0.4
        var a1_p = this.add.image(180,715,'a1_p')
        a1_p.scaleX = 0.4
        a1_p.scaleY = 0.4
        var n1_p = this.add.image(110,695,'n1_p')
        n1_p.scaleX = 0.4
        n1_p.scaleY = 0.4
    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}
