    showWord(word,answer){
        this_.result = []
        this_.id_arr = []
        var word_name = []
        var graphics_arr = []
        this_.graphics_name = []
        this_.graphics_n
        this_.ansewrNum = []
        var cursor = this_.add.image(-300,400,'cursor').setOrigin(0.5,0.1).setDepth(2)
        //循环添加对象
        for(var i = 0;i<word.length;i++){
            word_name[i] = this.add.image(word[i].x,word[i].y,word[i].name).setInteractive()
            word_name[i].id = word[i].id 
        }
        //循环移动事件
        for(var j = 0; j < word_name.length; j++){
            word_name[j].on('pointerdown',function(){
                this.scaleX = 1.2
                this.scaleY = 1.2
                if(this_.result.indexOf(this.texture.key) == -1){
                    this_.result.push(this.texture.key)
                    this_.id_arr.push(this.id)
                    console.log(this_.id_arr)
                }
                cursor.x = this.x
                cursor.y = this.y
                this_.input.on('pointermove',function(pointer){
                    cursor.x = pointer.x
                    cursor.y = pointer.y
                })
                for(var n = 0;n < word_name.length;n++){
                    word_name[n].once('pointermove',function(){
                        this.scaleX = 1.2 
                        this.scaleY = 1.2 
                        this.off('pointermove')   
                        if(this_.result.indexOf(this.texture.key) == -1){
                            this_.result.push(this.texture.key)
                            this_.id_arr.push(this.id)
                            console.log(this_.result)
                        }
                        this_.input.on('pointermove',function(pointer){
                            if (this_.graphics) {
                                this_.graphics.visible = 0
                            }
                            // if (this_.circle1) {
                            //     this_.circle1.visible = 0
                            //     this_.circle1_1.visible = 0
                            // }
                            this_.graphics = this_.add.graphics(0, 0)
                            this_.graphics.lineStyle(20, 0x00EE00, 0.5);
                            this_.graphics.moveTo(this.x , this.y);
                            this_.graphics.lineTo(pointer.x, pointer.y);
                            this_.graphics.strokePath();
                            // this_.circle1_1 = this_.add.image(this.x,this.y,'circle')
                            // this_.circle1 = this_.add.image(this.x,this.y,'circle')
                            // this_.circle1.x = pointer.x
                            // this_.circle1.y = pointer.y
                            if(this_.result.length >1){
                                for(var i = 0 ;i< this_.result.length;i++){
                                    var a = this_.result[i]
                                    for(var j = 0;j < word_name.length;j++){
                                        if(a == word_name[j].texture.key){
                                            if(graphics_arr.indexOf(word_name[j]) == -1){
                                                graphics_arr.push(word_name[j])
                                            }
                                            // console.log(word_name[j])
                                        }
                                    }
                                }
                                for(var i = 0;i<graphics_arr.length;i++){
                                    if(i+1<=graphics_arr.length-1){
                                        if(this_.graphics_name[i]){
                                            this_.graphics_name[i].destroy()
                                        }
                                        this_.graphics_name[i]= this_.add.graphics(0, 0)
                                        this_.graphics_name[i].lineStyle(20, 0x00EE00, 0.5);
                                        this_.graphics_name[i].moveTo(graphics_arr[i].x , graphics_arr[i].y);
                                        this_.graphics_name[i].lineTo(graphics_arr[i+1].x, graphics_arr[i+1].y); 
                                        this_.graphics_name[i].strokePath();
                                        if(this_.graphics_name.indexOf(this_.graphics_name[i]) == -1){
                                            this_.graphics_name.push(this_.graphics_[i])
                                        }
                                    }
                                }
                            }                                
                        },this)              
                    })
                }
            })
        }
        //抬起判断
        this.input.on('pointerup',()=>{
            for(var i = 0;i<word_name.length;i++){
                word_name[i].off('pointermove')
            }
            if(this_.graphics){
                this_.graphics.destroy()
                // this_.circle1.destroy()
                // this_.circle1_1.destroy()
            }
            this_.input.off('pointermove')

            for(var i = 0;i<this_.graphics_name.length;i++){
                this_.graphics_name[i].destroy()
            }
            graphics_arr = []
            this_.id_arr = []

            if (this_.graphics) {
                this_.graphics.destroy()
            }

            var result = this_.result.join('')
            if(answer.indexOf(result) != -1){
                if(this_.ansewrNum.indexOf(result) == -1){
                    this_.ansewrNum.push(result)
                }
                console.log(this_.result)
                for(var i = 0;i<word_name.length;i++){
                    this_.tweens.add({
                        targets:[word_name[i]],
                        scaleX:1.0,
                        scaleY:1.0,
                        duration:400,
                        ease:'Back',
                        onComplete:()=>{
                            this_.scene.start('game3')
                        }
                    })
                }
                for(var i = 0;i<word_name.length;i++){
                    word_name[i].setTint(0x00EE00)
                    this_.kuang_name[i].setTint(0x00EE00)
                }
            }else{
                for(var i = 0 ;i< this_.result.length;i++){
                    var a = this_.result[i]
                    for(var j = 0;j < word_name.length;j++){
                        if(a == word_name[j].texture.key){
                            var b = word_name[j]
                            this_.tweens.add({
                                targets:[word_name[j]],
                                angle:8,
                                scaleX:1.1,
                                scaleY:1.1,
                                duration:200,
                                onComplete:()=>{
                                }
                            })
                            this_.tweens.add({
                                targets:[word_name[j]],
                                delay:200,
                                angle:-8,
                                scaleX:1.0,
                                scaleY:1.0,
                                duration:200,
                                onComplete:()=>{
                                }
                            })
                            this_.tweens.add({
                                targets:[word_name[j]],
                                delay:400,
                                angle:0,
                                duration:200,
                                onComplete:()=>{
                                }
                            })
                        }
                    }
                }
                var n = 0
                var st = setInterval(function(){
                    n++;
                    for(var i = 0;i<word_name.length;i++){
                        word_name[i].setTint(0xCD0000)
                    }
                    setTimeout(() => {
                        for(var i = 0;i<word_name.length;i++){
                            word_name[i].setTint(0xffffff)
                        }  
                    }, 100);
                    if (n >= 4) {
                        clearInterval(st);
                    }
                },100);
                
                for(var i = 0;i<this_.answer_name.length;i++){
                    for(var j = 0;j<this_.answer_name[i].length;j++){
                        this_.answer_name[i][j].visible = 0
                    }
                }

                this_.result = []
            }
        })
    }  

